  [],\n\t\"revision_timestamp\": \"2016-08-30T13:29:43.189063\",\n\t\"name\": \"northwest-national-marine-renewable-energy-center-final-technical-report-appendices\",\n\t\"isopen\":
  true,\n\t\"url\": null,\n\t\"notes\": \"In 2008, the US Department of Energy (DOE)
  Wind and Water Power Program issued a funding opportunity announcement to establish
  university-led National Marine Renewable Energy Centers. Oregon State University
  and the University of Washington combined their capabilities in wave and tidal energy
  to establish the Northwest National Marine Renewable Energy Center, or NNMREC. NNMREC's
  scope included research and testing in the following topic areas: ntAdvanced Wave
  Forecasting Technologies;ntDevice and Array Optimization;ntIntegrated and Standardized
  Test Facility Development;ntInvestigate the Compatibility of Marine Energy Technologies
  with Environment, Fisheries and other Marine Resources;ntIncreased Reliability and
  Survivability of Marine Energy Systems;n        Collaboration/Optimization with
  Marine Renewable and Other Renewable Energy Resources.nTo support the last topic,
  the National Renewable Energy Laboratory (NREL) was brought onto the team, particularly
  to assist with testing protocols, grid integration, and testing instrumentation.nNNMREC's
  mission is to facilitate the development of marine energy technology, to inform
  regulatory and policy decisions, and to close key gaps in scientific understanding
  with a focus on workforce development. In this, NNMREC achieves DOE's goals and
  objectives and remains aligned with the research and educational mission of universities.
  nIn 2012, DOE provided NNMREC an opportunity to propose an additional effort to
  begin work on a utility scale, grid connected wave energy test facility. That project,
  initially referred to as the Pacific Marine Energy Center, is now referred to as
  the Pacific Marine Energy Center South Energy Test Site (PMEC-SETS) and involves
  work directly toward establishing the facility, which will be in Newport Oregon,
  as well as supporting instrumentation for wave energy converter testing.nThis report
  contains a breakdown per subtask of the funded project. Under each subtask, the
  following are presented and discussed where appropriate: the initial objective or
  hypothesis; an overview of accomplishments and approaches used; any problems encountered
  or departures from planned methodology over the life of the project; impacts of
  the problems or rescoping of the project; how accomplishments compared with original
  project goals; and deliverables under the subtasks. Products and models developed
  under the award are also included.n\",\n\t\"license_title\": \"Creative Commons
